import React from 'react';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import './Rightbar.css';
import add_image from "../../Assets/add-image.jpg";
import birthday from "../../Assets/birthday-icon.jpg";

function Rightbar() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-auto bg-none min-vh-100">
          <div className="">
          <img src={birthday} className="img-thumbnail img" alt="maincard " />
          <a href="#" className="text-black link-tag font-bold">
                Upcoming Birthdays
              </a>

          </div>

        </div>


      </div>
    </div>
  )
}

export default Rightbar
